	SecurityRoleType_Value122267 = "122267" // BSA = 0.010265 * WT ^ 0.423 * HT ^ 0.651: Body Surface Area computed from patient height and weight: BSA = 0.010265 * WT[kg] ^ 0.423 * HT[cm] ^ 0.651 (For East Asian child aged 12-14 years)
