	SecurityRoleType_Value122269 = "122269" // BSA = 0.038189 * WT ^ 0.423 * HT ^ 0.362: Body Surface Area computed from patient height and weight: BSA = 0.038189 * WT[kg] ^ 0.423 * HT[cm] ^ 0.362 (For East Asian child aged 1-5 years)
