	MediaTypeCode_Value113860 = "113860" // 15cm from Isocenter toward Source: 15cm from the isocenter towards the X-Ray source; See IEC 60601-2-43
	MediaTypeCode_Value113861 = "113861" // 30cm in Front of Image Input Surface: 30cm in front (towards the tube) of the input surface of the image receptor; See FDA Federal Performance Standard for Diagnostic X-Ray Systems Â§1020.32(d) (7)
	MediaTypeCode_Value113862 = "113862" // 1cm above Tabletop: 1cm above the patient tabletop or cradle; See FDA Federal Performance Standard for Diagnostic X-Ray Systems Â§1020.32(d) (7)
	MediaTypeCode_Value113863 = "113863" // 30cm above Tabletop: 30cm above the patient tabletop of cradle; See FDA Federal Performance Standard for Diagnostic X-Ray Systems Â§1020.32(d) (7)
	MediaTypeCode_Value113864 = "113864" // 15cm from Table Centerline: 15cm from the centerline of the X-Ray table and in the direction of the X-Ray source; See FDA Federal Performance Standard for Diagnostic X-Ray Systems Â§1020.32(d) (7)
	MediaTypeCode_Value113865 = "113865" // Entrance exposure to a 4.2 cm breast thickness: Standard breast means a 4.2 centimeter (cm) thick compressed breast consisting of 50 percent glandular and 50 percent adipose tissue. See Department of Health and Human Services, Food and Drug Administration. Mammography quality standards; final rule. Federal Register. Oct. 28, 1997; 68(208):55852-55994; see 900.2(uu)
