	MediaTypeCode_Value125204 = "125204" // Area-length biplane: Method for calculating left ventricular volume from two orthogonal views containing the true long axis (usually the apical 4 and 2 chamber views). Volume = [pL1 / 6] * [(4A1) Ã· (pL1) ] * [(4A2) Ã· (pL2) ]
