	MediaTypeCode_Value125216 = "125216" // Proximal Isovelocity Surface Area: Utilizes aliasing velocity (by color Doppler) of flow into an orifice (often regurgitant or stenotic) to measure instantaneous flow rate, orifice area, and flow volume. The instantaneous flow rate = (2Ï€r2vav ) * (Î± / Ï€) where vav is the constant velocity known as aliasing velocity at radius r, vp is the peak velocity at the orifice, and Î± is the angle in radians of the constant velocity surface. Estimated Orifice area = Flow rate / vp , where vp is the peak velocity at the orifice and the flow rate is the PISA peak flow rate. The volume flow is then the product of the orifice area and Velocity Time Integral
